import math

def threeEqualParts(arr):
     num=sum([x*2**y for x, y in zip(arr, list(range(len(arr)-1, -1, -1)))])
     if  num == 0:
         return [0, len(arr)-1]
     count=0
     for x in range(0, len(arr)):
         count*=2
         count+=arr[x]
         second_pt=num-count*2**(len(arr)-x-1)
         middle=second_pt-count
         if middle > 0 and count > 0 and middle%count==0 and ( middle//count & -(middle//count) ) == middle//count:
             length=int(math.log(middle//count)/math.log(2))
             i=0
             while arr[i] == 0:
                 i+=1
             if len(arr) - x-1 - max(length, x+1-i)  >=  x+1-i and length > x-i:
                 return [x, len(arr)-length]
     return [-1, -1]


